	add("teleogenesis", "{\"term\":\"teleogenesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|teleo|genesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Autonomous setting of goal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A regime of controlled, intentional reproductio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"in the same way that appetite has ensured the intake of food, sexual compulsion has ensured the placement of sperm. Under \u0027\u0027teleogenesis\u0027\u0027 this would no longer be the case\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The preferential evolution of features and organs in certain way\", \"priority\":4}]}, \"synonyms\":{}}");

	add("teleology", "{\"term\":\"teleology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027τέλος\u0027 (purpose) + \u0027λόγος\u0027 (word, speech, discourse)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the purpose or design of natural occurrences\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instance of such a design or purpose, usually in natural phenomena\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Paul A. Rahe, \u0027[http://ricochet.com/main-feed/Truths-You-Cannot-Utter Truths You Cannot Utter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In short, what every student of biology knows – that within nature there is a \u0027\u0027teleology\u0027\u0027 having to do with the survival of the species which underpins the distinction between the two sexes and produces between them a natural affinity for one another – no surgeon who knows what is good for him may now say\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The use of a purpose or design rather than the laws of nature to explain an occurrence\", \"priority\":5}]}, \"synonyms\":{}}");

	add("teleonomy", "{\"term\":\"teleonomy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|teleo|nomy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of living organisms of seeming to be organized towards the attainment of an end\", \"priority\":1}]}, \"synonyms\":{}}");

	add("teleoperation", "{\"term\":\"teleoperation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|tele|operation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The remote operation of a device\", \"priority\":1}]}, \"synonyms\":{}}");

	add("teleosemantics", "{\"term\":\"teleosemantics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|teleo|semantics|lang\u003den}}, introduced by {{w|Ruth Millikan}} who attributes it to Steven Wagner.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The view that the notion of representation should be defined with respect to biological function\", \"priority\":1}]}, \"synonyms\":{}}");

	add("telepathy", "{\"term\":\"telepathy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|tele|pathy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The capability to communicate directly by psychic means; the sympathetic affection of one mind by the thoughts, feelings, or emotions of another at a distance, without communication through the ordinary channels of sensation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("telephone", "{\"term\":\"telephone\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"{{confix|tele|phone|lang\u003den}}.From French \u0027téléphone\u0027 from Ancient greek (to 1453) \u0027τῆλε\u0027 (afar) + \u0027φωνή\u0027 (voice, sound)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A telecommunication device (originally mechanical, and now electronic) used for two-way talking with another person (often shortened to phone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Chinese whispers\", \"priority\":2}]}, \"synonyms\":{\"list\":[{\"text\":\"dog and bone\", \"synonymQualifier\":\"SLANG\"},{\"text\":\"horn\", \"synonymQualifier\":\"INFORMAL\"}]}}");

