	add("teleportitis", "{\"term\":\"teleportitis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|teleport|itis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In some roguelike games, an intrinsic ability that causes the player\u0027s character to teleport from place to place without warning\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, \u0026quot;Aaron Sher\u0026quot;, \u0027Teleportation\u0027 (on newsgroup \u0027rec.games.hack\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Teleportitis\u0027\u0027 is gained by eating a leprechaun or quantum mechanic or nymph\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0026quot;Rorschach\u0026quot;, \u0027YAVP: Argos the Merry Minotaur\u0027 (on newsgroup \u0027rec.games.roguelike.misc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That ring stayed on his finger until resists became more an issue than damage output, and stayed off when I got \u0027\u0027teleportitis\u0027\u0027 in the Slime pits and had to rely on teleport control\", \"priority\":5}]}, \"synonyms\":{}}");

