	add("teleprogram", "{\"term\":\"teleprogram\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|tele|program|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any computer program acquired as telesoftware\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, Ján Gecsei, \u0027The architecture of videotex systems\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The architecture should provide for a reliable communication infrastructure required for the transfer of files (\u0027\u0027teleprograms\u0027\u0027, displayable pages\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Hugh T Smith, \u0027Computer-based message services\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"After having finished composing the text, the \u0027\u0027teleprogram\u0027\u0027 tells the PI0 to establish the telephone connection to the VTX center and sends the text\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, OCLC FirstSearch Electronic Collections Online, \u0027Information services and use\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Obviously, appropriate interfaces between the magazine-manager and the \u0027\u0027teleprograms\u0027\u0027 will have to be made. At this point such systems are not yet implemented\", \"priority\":7}]}, \"synonyms\":{}}");

