	add("telescope", "{\"term\":\"telescope\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"{{confix|tele|scope|lang\u003den}}.From Latin \u0027telescopium\u0027 from Ancient greek (to 1453) \u0027τηλεσκόπος\u0027 (far-seeing) from \u0027τῆλε\u0027 (afar) + \u0027σκοπέω\u0027 (i look at) Coined in 1611 by the Greek mathematician w:Giovanni Demisiani|Giovanni Demisiani for one of w:Galileo Galilei|Galileo Galilei\u0027s instruments presented at a banquet at the w:Accademia dei Lincei|Accademia dei Lincei.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A monocular optical instrument possessing magnification for observing distant objects, especially in astronomy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any instrument used in astronomy for observing distant objects (such as a radio telescope\", \"priority\":2}]}, \"synonyms\":{}}");

