	add("television", "{\"term\":\"television\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027télévision\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Image:Early portable thumb|An early television (2\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An electronic communication medium that allows the transmission of real-time visual images, and often sound\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It’s a good thing that \u0027\u0027television\u0027\u0027 doesn’t transmit smell\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A device for receiving television signals and displaying them in visual form\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I have an old \u0027\u0027television\u0027\u0027 in the study\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Collectively, the programs broadcast via the medium of television\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"fifty-seven channels and nothing on \u0027\u0027television\", \"priority\":7}]}, \"synonyms\":{}}");

	add("televisualization", "{\"term\":\"televisualization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|televisual|ization|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Translation into a televisual format; televising\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Janine Marchessault, Susan Lord, \u0027Fluid screens, expanded cinema\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This goes against the current of the \u0027\u0027televisualization\u0027\u0027 of the Web, where the end-user-defined HTML language is being submerged in a wave of server-defined Javascript\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The introduction of television to a region\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Toby Miller, \u0027Cultural citizenship\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"After the War and the simultaneous suburbanization and \u0027\u0027televisualization\u0027\u0027 of the United States, the weather report was positioned as an entertaining forum\", \"priority\":6}]}, \"synonyms\":{}}");

