	add("telford", "{\"term\":\"telford\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Named after Thomas Telford, a famous civil engineer.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A new town in the borough of Telford and Wrekin and the ceremonial county of Shropshire, England\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A road pavement having a surface of small stone rolled hard and smooth, distinguished from macadam road by its firm foundation of large stones with fragments of stone wedged tightly in the interstices\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027Telford\u0027\u0027 road\", \"priority\":3}]}, \"synonyms\":{}}");

