	add("telishment", "{\"term\":\"telishment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Coined by {{w|John Rawls}} in his 1955 paper “Two Concepts of Rules”. Probably a {{l|en|portmanteau}} of the Ancient greek (to 1453) \u0027τέλος\u0027 (result”, “end”, \u0027loosely\u0027 “the greater good) and the English \u0027punishment\u0027 Compare \u0027telish\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The practice or institution of punishing the for the sake of providing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027, “[http://www.jstor.org/stable/2182230 Two Concepts of Rules]” in \u0027\u0027 LXIV, № 1, page 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Try to imagine, then, an institution (which we may call “\u0027\u0027telishment\u0027\u0027”) which is such that the officials set up by it have authority to arrange a trial for the condemnation of an innocent man whenever they are of the opinion that doing so would be in the best interests of society\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An instance of\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1961\u0027\u0027, \u0027Human Conduct: An Introduction to the Problems of Ethics\u0027, [http://books.google.co.uk/books?id\u003dr1foiq27DgwC\u0026amp;q\u003d%22telishments%22\u0026amp;dq\u003d%22telishments%22\u0026amp;source\u003dbl\u0026amp;ots\u003dvJ-zrOOKmD\u0026amp;sig\u003dWMVJgS1SKH4iURRziNrI5ihaVeY\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dpqpMUP3xMKGa1AXq-oGYCQ\u0026amp;ved\u003d0CDAQ6AEwAA page 457\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And I would say the same about punishments — not \u0027\u0027telishments\u0027\u0027, but punishments — in which the penalty is far too severe\", \"priority\":6}]}, \"synonyms\":{}}");

	add("telly", "{\"term\":\"telly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Televisio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Not much on \u0027\u0027telly\u0027\u0027 tonight, as usual\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A television se\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We\u0027ve got a new, flat-screen \u0027\u0027telly\", \"priority\":4}]}, \"synonyms\":{}}");

